import {useEffect, useState} from "react";
import api from "../services/api";
import { useNavigate } from "react-router-dom";


export default function Home(){
    const [summoner, setSummoner] = useState("");
    let navigate = useNavigate();
    function handleClick() {
        navigate(`/summoner/${summoner}`);
      }

    useEffect(() => {
        api.post('summoner/:summonerName', ).then((res) => console.log(res.data)).catch(e => console.log("porra"));
    }, []);
    return (
        <form>
            <input id="GET-name" type="text" name="name" value={summoner} onChange={(e) => setSummoner(e.target.value)}/>
            <button
            type="button"
            onClick={() => handleClick(summoner)}
            >
                <strong>BUSCAR</strong>
            </button>
        </form>
    )
}
